import { StrictMode } from "react";
import { createRoot } from "react-dom/client";

import { App } from "./App";
import { HashRouter } from "react-router-dom";

const root = createRoot(document.getElementById("app"));

root.render(
  <StrictMode>
    <HashRouter base="/">
      <App />
    </HashRouter>
  </StrictMode>
);
